import Image from "./img/mainvisual";
export const Mv = (props) => {
  const { children } = props;
  return (
    <Imgbox>
      {console.log(children)}
      <Img src={Image} />
    </Imgbox>
  );
};
const Imgbox = styled.div`
  width: 100%;
`;
const Img = styled.img`
  object-fit: cover;
`;
